import React, {Component} from 'react';

class Movie extends Component {
  render() {
    return(
      <div
        className="movie-item"
        // key={this.props.id}
        >
        <p>Title: {this.props.title}</p>
        <p>Date watched: {this.props.dateWatched}</p>
      </div>
    );
  }
}

export default Movie;
